import base64from aiogram import F, Botfrom aiogram.fsm.state import StatesGroup, Statefrom aiogram.types import CallbackQuery, FSInputFile, BufferedInputFile, InputMediaPhotofrom aiogram.utils.keyboard import InlineKeyboardBuilderfrom database import Userfrom database.models.users import DocumentTypefrom handlers.admin.base import AdminCallbackfrom handlers.routers import admin_routerfrom helpers.functions import generate_user_report_in_memory@admin_router.callback_query(AdminCallback.filter(F.action == 'user_check_doc'))async def get_user_verification(call: CallbackQuery, callback_data: AdminCallback, bot: Bot, user: User):    user = await User.find_one(User.user_id == callback_data.user_id)    if user:        document = generate_user_report_in_memory(user)        print(document)        byte_stream = generate_user_report_in_memory(user)        document = BufferedInputFile(byte_stream.read(), filename=f'user_report_{user.user_id}.docx')        await call.message.answer_document(document)